import React from "react";
import bg from "./faq.png";

const myComponentStyle = {
  background: `liner`,
};
const Blogs = () => {
  return (
    <div>
      <div className="text-center">
        <p className="text-primary font-medium">Blogs</p>
        <p className="font-bold text-xl"> Get ready for healhy blogs </p>
      </div>
      <div className="flex  ">
        <div
          className="    drop-shadow-2xl  h-80 w-64 m-8 flex brightness-50  rounded  bg-primary bg-[url('https://1.bp.blogspot.com/-kK7Fxm7U9o0/YN0bSIwSLvI/AAAAAAAACFk/aF4EI7XU_ashruTzTIpifBfNzb4thUivACLcBGAsYHQ/s1280/222.jpg')] bg-cover bg-center 
         "
          style={myComponentStyle}
        >
          <div className="self-end px-8 text-white font-bold brightness-100">
            Homeopathy: What You Need to Know
          </div>
        </div>

        <div
          className=" box h-80 w-64 m-8 flex brightness-50  rounded  bg-primary bg-[url('https://1.bp.blogspot.com/-kK7Fxm7U9o0/YN0bSIwSLvI/AAAAAAAACFk/aF4EI7XU_ashruTzTIpifBfNzb4thUivACLcBGAsYHQ/s1280/222.jpg')] bg-cover bg-center 
         "
          style={myComponentStyle}
        >
          <img src="/images/gradient.png" className="rounded self-end "></img>
        </div>

        <div
          className=" box  backdrop-brightness-100 h-80 w-64 m-8 flex brightness-50  rounded  bg-primary bg-[url('https://1.bp.blogspot.com/-kK7Fxm7U9o0/YN0bSIwSLvI/AAAAAAAACFk/aF4EI7XU_ashruTzTIpifBfNzb4thUivACLcBGAsYHQ/s1280/222.jpg')] bg-cover bg-center 
         "
          style={myComponentStyle}
        >
          <div className="self-end px-8 text-white font-bold brightness-100 z-10">
            Homeopathy: What You Need to Know
          </div>
          <img
            src="/images/gradient.png"
            className="rounded self-end positon-bottom-0 -z-10 position-right-0"
          ></img>
        </div>
      </div>
    </div>
  );
};

export default Blogs;
